import React, { Component } from 'react';
//import the BrowserRouter, Route, and Link components
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';

//import stylesheets
import './App.css';
import './index.css';

//import page components
import Landing from './components/landing';
import Portfolio from './components/portfolio';
import Footer from './components/footer';
import Navbar from './components/navbar';
import About from './components/about';
import Contact from './components/contact';
import Accelerator from './components/projects/accelerator';
import Newsletter from './components/projects/newsletter';
import Biscuits from './components/projects/biscuits';
import AnnArbor from './components/projects/ann-arbor';
import GreenerDining from './components/projects/greenerdining';
import Spain from './components/projects/spain';
import India from './components/projects/india';
import Michigan from './components/projects/michigan';
import Chicago from './components/projects/chicago';
import Connected from './components/projects/connected';

class App extends Component {
  render () {
    return (
      <Router>
        <div>
          <Navbar/>

          <Switch>
            <Route exact path="/" component={Landing}/>
            <Route exact path="/home" component={Landing}/>
            <Route exact path="/about" component={About}/>
            <Route exact path="/portfolio" component={Portfolio}/>

            <Link to="/accelerator" component={Accelerator}/>
            <Route exact path="/portfolio/accelerator" component={Accelerator}/>
            <Route exact path="/portfolio/newsletter" component={Newsletter}/>
            <Route exact path="/portfolio/biscuits" component={Biscuits}/>
            <Route exact path="/portfolio/ann-arbor" component={AnnArbor}/>
            <Route exact path="/portfolio/greener-dining" component={GreenerDining}/>
            <Route exact path="/portfolio/spain" component={Spain}/>
            <Route exact path="/portfolio/india" component={India}/>
            <Route exact path="/portfolio/michigan" component={Michigan}/>
            <Route exact path="/portfolio/chicago" component={Chicago}/>
            <Route exact path="/portfolio/connected" component={Connected}/>

            <Route exact path="/contact" component={Contact}/>

          </Switch>

          <Footer/>
        </div>
      </Router>

    );
  }
}

export default App;
